import React, { Component } from 'react';

export default class App extends Component {
    render = () => (
      <Provider store={SportsStoreDataStore}>
        <Router>
          <Switch>
            <Route path="/shop" component={ShopConnector} />
            <Redirect to="/shop" />
          </Switch>
        </Router>
      </Provider>
    )
}
